public boolean equals(Object o) {
  if (this == o) {
    return true;
  }

  if (!(o instanceof SlowPeerReports)) {
    return false;
  }

  SlowPeerReports that = (SlowPeerReports) o;

  return slowPeers.equals(that.slowPeers);
}
